def my_func(input1: str) -> str:
    if not isinstance(input1, str) or len(input1) < 1 or len(input1) > 20:
        return ''

    def to_camel_case(s: str) -> str:
        parts = s.split('-')
        return parts[0] + ''.join(word.capitalize() for word in parts[1:])

    result = []
    for group in input1.split():
        result.append(to_camel_case(group))

    return ' '.join(result)
